import React from 'react';
import './App.css';
import Layout from './components/Layout/Layout';
import {BrowserRouter, Route} from 'react-router-dom';

function App() {
  return (
    <div className="App">
    <BrowserRouter>
    <Route exact={true} path='/' render={() => (
            <div className="App">
             <Layout/>
            </div>
         )}/>

      <Route exact={true} path='/info' render={() => (
            <div className="App">
              Hi
            </div>
         )}/>
    </BrowserRouter>
    </div>
  );
}

export default App;
